import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img
          src={
            "https://upload.wikimedia.org/wikipedia/commons/6/6c/Star_Wars_Logo.svg"
          }
          height="420"
          width="420"
          alt="logo"
        />

        <button className=" ">
          <span className="fa fa-star checked"></span>Do. Or do not. There is no
          try
        </button>
      </header>
    </div>
  );
}

export default App;
